    def g(a, b):
        if a >= b:
            (a, b) = (b, a)
        if b == a:
            return 0
        if b % a == 0:
            return b // a - 1
        r = g(b % a, a)
        q = b // a
        if r >= q:
            return q - 1
        else:
            return q

    def mex(x):
        n = len(x)
        for i in range(n):
            if i not in x:
                return i
        return n

    def g2(a, b):
        if a == b:
            return 0
        if a > b:
            (a, b) = (b, a)
        if b % a == 0:
            return b // a - 1
